import React from "react";
import { Input, Form, Button } from "antd";

const dummy = {
  isLoggedIn: true
};
const Home = () => {
  return (
    <>
      <div>
        {dummy.isLoggedIn && (
          <div>
            <Form encType="multipart/form-data">
              <Input.TextArea
                maxLength={140}
                placeholder="어떤 신기한 일이 있었나요?"
              ></Input.TextArea>
              <div>
                <Button>이미지 업로드</Button>
                <Button
                  type="primary"
                  style={{ float: "right" }}
                  htmlType="submit"
                >
                  짹짹
                </Button>
              </div>
            </Form>
          </div>
        )}
      </div>
    </>
  );
};
// 2-4 00:22
export default Home;
